import exercisesStore from "../stores/exercisesStore";

export default function ExerciseUpdate({exercise, number}) {
    const store = exercisesStore();

    return(
        <tr key={exercise._id}>
            <form onSumbit={store.updateExercise}>
                <td>{number}</td>
                <td><input name="name" value={exercise.name} onChange={store.updateUpdateFormField} /></td>
                <td><input name="weight" value={exercise.weight} onChange={store.updateUpdateFormField} /></td>
                <td><input name="sets" value={exercise.sets} onChange={store.updateUpdateFormField} /></td>
                <td><input name="reps" value={exercise.reps} onChange={store.updateUpdateFormField} /></td>
                <td><input name="intensity" value={exercise.intensity} onChange={store.updateUpdateFormField} /></td>
                <td><input name="notes" value={exercise.notes} onChange={store.updateUpdateFormField} /></td>
                <td className="delete" onClick={() => store.deleteExercise(exercise._id)}>X</td>
            </form>
        </tr>
    );
}
